import React, { Component } from 'react';
import { FormEngine, Form } from "react-json-form-engine";

import loginForm from './loginForm';



class FormBuilder extends Component { 
  constructor(props) {
    super(props);

    this.instance = new FormEngine(loginForm);
  }

  render() {
    return       <Form
    hideTitle
    submitButtonLabel="Login"
    instance={this.instance}
    onSubmit={() => {
      console.log(this.instance.getModelValues()); // Get form responses
      console.log(this.instance.serializeModel()); // Serialize form responses
    }}
  />
  }
}

export default FormBuilder
